import React, { Component } from 'react'

export class JsObject extends Component {
    constructor(){
        super()
        this.state={
            person :{
                firstname: "John",
                lastname: "Doe",
                age: 50,
                eyecolor: "blue"
              }
        }
    }
    render() {
        const {person}=this.state
        return (
            <div>
            <p>
                {
                  <h1>{person.firstname}</h1>
                }
            </p>
            </div>
        )
    }
}

export default JsObject
